import React from 'react';

function Details(props){
    const array=Array.from(props.character);
    return(
        <div className="details">
            <div className="row">
                <div className="col-md-12">
                    <h1>
                        {props.character.name}
                        <hr/>
                    </h1>
                </div>
            </div>
        </div>
    );
}

export default Details;
